import React from 'react';
import './App.css';
import Header from './Header';
import Technologies from './Technologies';

const App = () => {
  return (
    <div className = 'app_wrapper'>
      <header classNaam ='header'>
        <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSsuruOSLEm-uiaXsnIXl5iQVQxvjXiZKfuDA&usqp=CAU" />
      </header>
      <nav>
        <div>Profile</div>
        <div>Messages</div>
        <div>News</div>
        <div>Music</div>
      </nav>
      <div>
        Main content
      </div>
    </div>
  );
}

export default App;
